INSERT INTO `achievement_reward` VALUES (876, 0, 0, 0, 0, 0, 43349, 29533, 'I\'ve been watching you, kid.', 'You\'ve got quite a knack for throwing down in that arena. Keep this. Wear it with pride. Now get back in there and show them how it\'s done!$B$BUncle Sal', '');
