INSERT INTO `achievement_reward` VALUES (4602, 0, 0, 0, 0, 0, 51954, 37120, 'Glory of the Icecrown Raider', '$N,$B$BAs the Lich King\'s influence wanes, some of his more powerful minions have wrested free of his grasp.$B$BThis frost wyrm drake my men captured is a prime example. She has a will of her own and then some.$B$BOne of my men lost an arm breaking her in, but she now takes to riders fairly well -- provided they themselves are skilled and strong willed.$B$BPlease accept this magnificent beast as a gift from the Knights of the Ebon Blade. It was an honor to fight along your side in this greatest of battles.$B$BWith honor,$BDarion Mograine.', '');
INSERT INTO `achievement_reward` VALUES (4603, 0, 0, 0, 0, 0, 51955, 37120, 'Glory of the Icecrown Raider', '$N,$B$BAs the Lich King\'s influence wanes, some of his more powerful minions have wrested free of his grasp.$B$BThis frost wyrm drake my men captured is a prime example. She has a will of her own and then some.$B$BOne of my men lost an arm breaking her in, but she now takes to riders fairly well -- provided they themselves are skilled and strong willed.$B$BPlease accept this magnificent beast as a gift from the Knights of the Ebon Blade. It was an honor to fight along your side in this greatest of battles.$B$BWith honor,$BDarion Mograine.', '');
INSERT INTO `achievement_reward` VALUES (4845, 0, 0, 0, 0, 0, 62900, 53905, 'Glory of the Cataclysm Hero', 'Champion,$b$bI have received word of your great deeds from my allies in the Earthen Ring. Many have taken up arms in defense of our troubled world, but your achievements are of particular note.$b$bPlease accept this gift in recognition of your skill and bravery. With heroes like you and your comrades assisting our cause, we may yet prevail.$b$bThrall', '');
INSERT INTO `achievement_reward` VALUES (4853, 0, 0, 0, 0, 0, 62901, 53905, 'Glory of the Cataclysm Raider', 'Champion,$b$bI have received word of your great deeds from my allies in the Earthen Ring. Many have taken up arms in defense of our troubled world, but your achievements are of particular note.$b$bYour bravery should not go unrecognized. Please accept this gift on behalf of the Earthen Ring. With heroes like you and your comrades assisting our cause, we may yet prevail.$b$bThrall', '');
