INSERT INTO `achievement_reward` VALUES (5859, 0, 0, 0, 0, 0, 69854, 52823, 'Find', 'I found this medallion in the Volcanic depths, next to the lava river. He clearly did not belong to the supreme druids, rather to some of the flame druids.\r\n\r\nHowever, it does not matter who owned it before. $BM need it all the more. Accept it as a reward for everything that you have done for us.', '');
INSERT INTO `achievement_reward` VALUES (5860, 0, 0, 0, 0, 0, 69838, 40578, 'Tweetbox', 'This baby is completely out of hand since he was separated from his brother.\r\nThe guards and I struggled to keep him, but all is useless:\r\nhe wants only one thing - to see his bloodline again. $B\r\n\r\nYou should know how much effort it took to pack it!\r\nTake it, for heavens sake.\r\nPerhaps outside the cave he will calm down a bit. $B\r\nFarden Talonwing', '');
INSERT INTO `achievement_reward` VALUES (5866, 0, 0, 0, 0, 0, 69213, 52845, 'A Gift From the Arch Druid', 'Never again will Hyjal shudder beneath the endless forces of Flame. Never again shall the mortal races of the World tremble before the minions of Ragnaros.$B\r\nNow, thanks to your efforts, they will tremble before Us.$B\r\nYour heroism on the Molten Front has been instrumental in the fight against the Firelord. You have gathered allies from all over Kalimdor and turned them into an Army. You have fought the minions of Ragnaros... and prevailed. And for that, you have our deepest thanks.\r\nNever again will Hyjal shudder beneath the endless forces of Flame. Never again shall the mortal races of the World tremble before the minions of Ragnaros.$B\r\nNow, thanks to your efforts, they will tremble before Us.$B\r\nYour heroism on the Molten Front has been instrumental in the fight against the Firelord. You have gathered allies from all over Kalimdor and turned them into an Army. You have fought the minions of Ragnaros... and prevailed. And for that, you have our deepest thanks.', '');
INSERT INTO `achievement_reward` VALUES (5875, 0, 0, 0, 0, 0, 54810, 28951, 'Littlest Pet Shop', NULL, '');
INSERT INTO `achievement_reward` VALUES (5876, 0, 0, 0, 0, 0, 71140, 28951, 'I\'m Going Nuts!', 'Hello again. Friend!$b$bThis mischievous little fellow is driving everyone in the pet store nuts!$b$bI thought you might take him along on some of your adventures... Perhaps he\'ll calm down after he\'s seen a bit of the world.$b$bYou DO wear a helmet, right... ?$b$b--Breanni', '');
