INSERT INTO `achievement_reward` VALUES (6378, 0, 0, 0, 0, 0, 90155, 67023, 'Conqueror Reward', 'Great <class>, We carefully watched your actions, and you did not disappoint us. Like a destructive whirlwind, you went through the ranks of enemies, leaving behind you mountains of corpses of mogu, praying mantis and other terrible creatures.\r\n\r\nAs a reward for your merits, we hand you a set of our best armor. Nowhere in Azeroth will you find anything like it. This armor literally becomes a part of you, reacting to your every movement, to your every thought.\r\n\r\nWear it with pride, and let everyone who sees you admire your courage. Congratulations!', '');
INSERT INTO `achievement_reward` VALUES (6402, 0, 0, 0, 0, 0, 86562, 59822, 'I have something for you there!', 'Hello there dear!\r\n\r\nThis little guy was scratching at the door after you left. I think he\'s taken quite a liking to you.\r\n\r\nDo come visit the brewery again some time. I just made more cookies!\r\n\r\n--Auntie Stormstout', '');
