INSERT INTO `achievement_reward` VALUES (6716, 0, 0, 0, 0, 129671, 83076, 61962, 'Between a Saurok and a Hard Place', 'Greetings $n,\r\nI hear you have learned much of the dreaded saurok. There is much more to this ancient foe than meets the eye. Please join us at the Seat of Knowledge so that we may compare our notes together!\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6724, 317, 317, 0, 0, 0, 0, 0, NULL, NULL, '');
