INSERT INTO `achievement_reward` VALUES (6754, 0, 0, 0, 0, 129671, 83772, 61962, 'The Dark Heart of the Mogu', 'Greetings $n,\r\nI hear your studies of the ancient mogu are progressing well. We can learn much from the greatness of their ancient empire, as well as the swiftness of its fall. Come join us at the Seat of Knowledge and I will share with you some additional perspective on our old foe.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6827, 0, 0, 0, 0, 0, 81559, 61847, 'Hello Traveler!', 'It has been a long time since we have seen one so devoted to our local Pandaren factions. You have put in many days of hard work to reach this lofty goal.\r\nTake this token of our appreciation, and know that you are welcome in Pandaria at all times.', '');
INSERT INTO `achievement_reward` VALUES (6828, 0, 0, 0, 0, 0, 89785, 61847, 'Hello Traveler!', 'It has been a long time since we have seen one so devoted to our local Pandaren factions. You have put in many days of hard work to reach this lofty goal.\r\nTake this token of our appreciation, and know that you are welcome in Pandaria at all times.', '');
INSERT INTO `achievement_reward` VALUES (6846, 0, 0, 0, 0, 129671, 83771, 61962, 'Fish Tales', 'Greetings $n,\r\nI hear you have learned much of the clever Jinyu. Perhaps you should join us at the Seat of Knowledge and share with us this wisdom you have learned.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6847, 0, 0, 0, 0, 129671, 83777, 61962, 'The Song of the Yaungol', 'Greetings $n,\r\nI hear you have been studying the marauding yaungol. There is much more to this hardy race than meets the eye. I would like to share with you some of my own perspectives - please join me at the Seat of Knowledge so that we can talk.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6850, 0, 0, 0, 0, 129671, 83770, 61962, 'Hozen in the Mist', 'Greetings $n,\r\nI understand you have been doing some research into the nature of the hozen. You are very brave to do so - they are an extremely unruly people. Come! Join me at the Seat of Knowledge and we will compare what we have learned.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6855, 0, 0, 0, 0, 129671, 83779, 61962, 'The Last Emperor', 'Greetings $n,\r\nI have heard that you have walked the path of our last and greatest emperor, ShaoHao. This is a subject very dear to me and I have spent many years studying his journey. Please, visit us in the Seat of Knowledge so that we may talk!\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6856, 0, 0, 0, 0, 129671, 83780, 61962, 'The Ballad of Liu Lang', 'Greetings $n,\r\nI have heard that you have discovered quite a tale about the wanderer Liu Lang. Perhaps you should join us at the Seat of Knowledge and share with us this wisdom you have learned.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6857, 0, 0, 0, 0, 129671, 83773, 61962, 'Heart of the Mantid Swarm', 'Greetings $n,\r\nI have heard that you have ventured to uncover the dark secrets of the mantid. Please join us at the Seat of Knowledge and I will help give you some perspective on this unique culture.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (6858, 0, 0, 0, 0, 129671, 83774, 61962, 'What Is Worth Fighting For', 'Greetings $n,\r\nI understand that you have been studying the history of pandaren fighting and the heroes who forged its techniques. Perhaps you should join us at the Seat of Knowledge so that we can compare what you have learned to the current historical record.\r\nIncluded should be a map to our location.\r\nI look forward to our next meeting.\r\nSincerely, Lorewalker Cho', '');
