INSERT INTO `achievement_reward` VALUES (7274, 0, 0, 0, 0, 0, 86596, 63721, 'Nat Pagle', 'Hey there Angler!\r\n\r\nI have really enjoyed building our friendship these past few weeks out at Angler\'s Wharf. I still can\'t believe how many rare catches you found and brought back for me to check out!\r\n\r\nI know you have been eyeing my fishing chair this whole time. So I decided to make you one of your own for all your hard work. I hope you enjoy it as much as I do!\r\n\r\nYour Pal.\r\n\r\nNat Pagle', '');
