INSERT INTO `achievement_reward` VALUES (10172, 0, 0, 0, 0, 0, 128363, 93822, 'Petty Officer', 'Captain,\r\n\r\nYou have exceeded all of my expectations commanding our fleet. Take this gift as a sign of my gratitude.\r\n\r\nWear it with honor.\r\n\r\n  Merreck Vonder', '');
